- input: "TEXT\x1CC00394353\x1C.TEXT\x1C\x1CF3A\x1CThe Canseco for Congress committee
    is amending the 2012 Post-General report to remove the $1,000 contribution from
    American Bankers Association (page 34 of original filing).  The contribution was
    reported in error, it should have been shown as being from American Bakers Association
    as this filing correctly reports.  Subsequently, a $1,000 receipt is being reported
    as an offset to operating expenditure to void the refund issued to American Bankers
    Association on 11/26/12 (page 120 of original filing).    In addition, the committee
    is amending the report to correctly report the $45.57 in-kind contribution (page
    44 of original filing) as being from the Freshman Hold'Em PAC rather than the
    Freshman Hold'em JFC as was reported on the original filing.  The committee is
    also amending the report to include an additional $109.15 in-kind from the Freshman
    Hold'Em PAC which was not reported originally.\n"
