  - name: TEXT4000
    number: '6'
    value: 'The Canseco for Congress committee is amending the 2012 Post-General report
      to remove the $1,000 contribution from American Bankers Association (page 34
      of original filing).  The contribution was reported in error, it should have
      been shown as being from American Bakers Association as this filing correctly
      reports.  Subsequently, a $1,000 receipt is being reported as an offset to operating
      expenditure to void the refund issued to American Bankers Association on 11/26/12
